import * as React from "react";

import {useState} from "react";
import {Button, Modal, ModalBody, ModalFooter, ModalHeader, Table} from "reactstrap";
import './style.css'

export default function Carreras() {
    // These routes are defined when this component is loaded on demand via
    // dynamic import() on the home page!

    const [key, setKey] = useState('')
    const [name, setName] = useState('')

    const handleKeyChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        setKey(event.target.value)
    }
    const handleNameChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        setName(event.target.value)
    }

    const careers: Array<{ key: string, name: string }> = []
    const [career, setCareer] = useState(careers)
    const [showModal, setShowModal] = useState(false)
    const handleShowModal = () => {
        setShowModal(true)
    }
    const handleCloseModal = () => {
        setShowModal(false)
        setButtonSubmitText('AGREGAR')
        setNull()
    }
    const [edit, setEdit] = useState(false)
    const [buttonSubmitText, setButtonSubmitText] = useState('AGREGAR')
    const [indexToEdit, setIndexToEdit] = useState(0)

    const handleSubmit = (event: React.FormEvent<HTMLFormElement>) => {
        event.preventDefault();
        if (edit === false) {
            setCareer([...career, {key: key, name: name}])
        } else {
            career[indexToEdit] = {...career[indexToEdit], key: key, name: name}
            setCareer(career)
            setButtonSubmitText('AGREGAR')
            setEdit(false)
        }
        setShowModal(false)
        setNull()
    }

    const deleteElement = (key: string) => {
        setCareer(career.filter(obj => obj.key !== key))
    }
    const editElement = (index: number) => {
        setKey(career[index].key)
        setName(career[index].name)
        setEdit(true)
        setButtonSubmitText('EDITAR')
        setIndexToEdit(index)
        handleShowModal()
    }
    const setNull = () => {
        setKey('')
        setName('')
    }
    return (

       <>
        <div className={"container"}>
                <h2 className={"text-center mt-5 text-success fw-bold text"}>CARRERAS</h2>
                <div className={"fondo"}>
                    <div className={"text-center py-4"}>
                        <Button color={"info"} outline onClick={() => handleShowModal()}>AGREGAR</Button>
                    </div>
                    <div>
                        {showModal &&
                            <Modal isOpen={showModal} toggle={() => handleShowModal()}>
                                <form onSubmit={handleSubmit}>
                                    <ModalHeader style={{backgroundColor: "#347094"}}>CARRERA</ModalHeader>
                                    <ModalBody style={{backgroundColor: "#4e86a9"}}>
                                        <label>
                                            Key:<input className={"ms-3"} type={"text"} value={key}
                                                       onChange={handleKeyChange} required/>
                                        </label>
                                        <br/><br/>
                                        <label>
                                            Name:<input className={"ms-3"} type={"text"} value={name}
                                                        onChange={handleNameChange} required/>
                                        </label>
                                    </ModalBody>
                                    <ModalFooter style={{backgroundColor: "#347094"}}>
                                        <Button color={"success"} type={"submit"}>{buttonSubmitText}</Button>
                                        <Button color={"danger"} onClick={() => handleCloseModal()}>CANCELAR</Button>
                                    </ModalFooter>
                                </form>
                            </Modal>
                        }
                    </div>
                    <div className={"mx-5 fondo-tabla border border-5 border-secondary rounded-5"}>
                        <Table className={"text-center table table-striped"}>
                            <thead>
                            <tr>
                                <th>#</th>
                                <th>CONTRASEÃ‘A</th>
                                <th>NOMBRE</th>
                                <th></th>
                                <th></th>
                            </tr>
                            </thead>
                            <tbody>
                            {
                                career.map((item, index: number) => (
                                    <tr className={"align-middle"}>
                                        <td>{index}</td>
                                        <td>{item.key}</td>
                                        <td>{item.name}</td>
                                        <td><Button color={"success"}
                                                    onClick={() => editElement(index)}>EDITAR</Button></td>
                                        <td><Button color={"danger"}
                                                    onClick={() => deleteElement(item.key)}>ELIMINAR</Button></td>
                                    </tr>
                                ))
                            }
                            </tbody>
                        </Table>
                    </div>
                </div>
            </div>

            
            <div id="carousel-controls" className="carousel slide mt-4" data-bs-ride="carousel">
                    <div className="carousel-inner">
                        <div className="carousel-item active">
                            <img height={"350px"} className="d-block w-100 border border-4 border-secondary rounded-5"
                                 src="https://cdn.discordapp.com/attachments/831740786638192653/1109180157513715772/t1.png"
                                 alt="..."/>
                        </div>
                        <div className="carousel-item">
                            <img height={"350px"} className="d-block w-100 border border-4 border-secondary rounded-5"
                                 src="data:image/jpeg;base64,"
                                 alt="..."/>
                        </div>
                        <div className="carousel-item">
                            <img height={"350px"} className="d-block w-100 border border-4 border-secondary rounded-5"
                                 src="data:image/jpeg;base64,"
                                 alt="..."/>
                        </div>
                    </div>
                    <button className="carousel-control-prev" type="button" data-bs-target="#carousel-controls"
                            data-bs-slide="prev">
                        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                        <span className="visually-hidden">ANTERIOR</span>
                    </button>
                    <button className="carousel-control-next" type="button" data-bs-target="#carousel-controls"
                            data-bs-slide="next">
                        <span className="carousel-control-next-icon" aria-hidden="true"></span>
                        <span className="visually-hidden">SIGUIENTE</span>
                    </button>
                </div>

                
       </>
    );
}